import React, {useState, useEffect, Fragment} from "react"
import { Row, Col,Image,ListGroup, Button, ListGroupItem , Card, Form} from "react-bootstrap"
import { useBootstrapBreakpoints } from "react-bootstrap/esm/ThemeProvider"
import {Link, useParams} from "react-router-dom"
import './productDetail.css'
import {useDispatch, useSelector} from 'react-redux'
import CircularIndeterminate from "../../Loader";
import { Rating } from "@mui/material"
import { getListProductDetails } from "../../../redux/actions/productActions"
//import { CartProvider, useCart } from "react-use-cart";
import { addToCart } from "../../../redux/actions/cartActions"
import 'react-toastify/dist/ReactToastify.css';
import { ToastContainer, toast } from 'react-toastify';





const ProductDetail = () => {
    const [quantity, setQuantity] = useState(1)
    const dispatch = useDispatch()
    const productDetail = useSelector(state => state.productDetail.productDetail)
    const dataProduct = productDetail
    const productLoading = useSelector(state => state.productDetail)
    const {loading, error, product } = productLoading
    const {id} = useParams()

    const addItemToCart = (id, quantity) => {
        dispatch(addToCart(id, quantity))
       
    }

    useEffect(() => {
    
      dispatch(getListProductDetails(id))
         
    }, [dispatch]
    )


   
 
    
    return (
        <div className="product-details-page">
          <Link to='/' className="btn btn-light my-3">Retour</Link>
    
          {loading ? (
            <CircularIndeterminate />
          ) : (
            <Fragment>
              <Row>
                <Col md={5}>
                  <Image src={dataProduct?.image} alt={dataProduct?.title} fluid />
                </Col>
                <Col md={5}>
                  <ListGroup variant="flush">
                    <ListGroup.Item>
                      <h1>{dataProduct?.title}</h1>
                    </ListGroup.Item>
                    <ListGroup.Item>
                      <Rating />
                    </ListGroup.Item>
                    <ListGroup.Item>
                      <h3>{dataProduct?.price}</h3>
                    </ListGroup.Item>
                    <ListGroup.Item>
                      <h2>{dataProduct?.description}</h2>
                    </ListGroup.Item>
                  </ListGroup>
                </Col>
                <Col md={2}>
                  <Card>
                    <ListGroup variant="flush">
                      <ListGroup.Item>
                        <Row>
                          <Col>Status:</Col>
                          <Col>
                            <h4>{dataProduct?.stock > 0 ? 'En Stock' : 'Épuisé'}</h4>
                          </Col>
                        </Row>
                      </ListGroup.Item>
                      {dataProduct?.stock > 0 && (
                        <ListGroup.Item>
                          <Row>
                            <Col xs='auto' className='my-1'>
                              <Form.Control
                                as='select'
                                value={quantity}
                                onChange={(e) => setQuantity(e.target.value)}
                              >
                                {[...Array(dataProduct?.stock).keys()].map((x) => (
                                  <option key={x + 1} value={x + 1}>
                                    {x + 1}
                                  </option>
                                ))}
                              </Form.Control>
                            </Col>
                          </Row>
                        </ListGroup.Item>
                      )}
                      <ListGroup.Item>
                        <Button
                          onClick={() => addItemToCart(dataProduct?.id, parseInt(quantity))}
                          defaultValue={dataProduct?.title}
                          className="btn-block"
                          type="button"
                        >
                          Ajouter au panier
                        </Button>
                      </ListGroup.Item>
                    </ListGroup>
                  </Card>
                </Col>
              </Row>
            </Fragment>
          )}
        </div>
      );
            }
export default ProductDetail
